import React from "react";
import { Outlet, Link } from "react-router-dom";

const UserRoot = () => {
  const userId = 1;
  return (
    <div className="wrapper2">
      <div className="nav">
        <ul>
          <li>
            <Link to="info">Info</Link>
          </li>
          <li>
            <Link to={`${userId}/edit`}>Edit</Link>
          </li>
          <li>Logout</li>
        </ul>
      </div>
      <div className="content">
        <Outlet />
      </div>
    </div>
  );
};

export default UserRoot;
